    HOTEL = '#'
    if k > 2 * (n - 2):
        return (True, None)
    grid = [EMPTY * n for _ in range(4)]
    if k % 2 == 0:
        m = k // 2
        s = EMPTY + HOTEL * m + EMPTY * (n - m - 1)
        grid[1] = s
        grid[2] = s
    elif k < n - 1:
        s = (HOTEL * k).center(n, EMPTY)
        grid[1] = s
    else:
        grid[1] = EMPTY + HOTEL * (n - 2) + EMPTY
        grid[2] = EMPTY + HOTEL * (k - n + 1) + EMPTY * (2 * n - k - 4) + HOTEL + EMPTY
    return (True, grid)

